import React from 'react';

function LoadingPage() {
  return (
    <div style={loadingStyles}>
      <h1>Loading...</h1>
      <p>Please wait while we load the content.</p>
    </div>
  );
}

const loadingStyles = {
  height: '100vh',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  flexDirection: 'column',
  fontSize: '1.5rem',
  backgroundColor: '#f0f0f0'
};

export default LoadingPage;
